import chessImage from "./chessBoard.png";
import comingSoon from "./comingSoon.png";

export const imagesData = [
  {
    img: chessImage,
    title: "Chess",
    isDone: true,
  },
  {
    img: comingSoon,
    title: "Checkers",
    isDone: false,
  },
];
